import React from 'react';
import './index.scss';

const Projects = () => {
    return (
        <>
        <div className="container portfolio-page">
            <h1 className="page-title">
                <AnimatedLetters
                    letterClass={letterClass}
                    strArray={['M', 'y', ' ', 'P', 'r', 'o', 'j', 'e', 'c', 't', 's']}
                    idx={15}
                />
            </h1>
            
        </div>
        <Loader type='line-scale-pulse-out' />
    </>
    );
};

export default Projects;
